import s from "./menuMobile.module.css";

import logo from "../../assets/images/svg/logo-bookmark.svg";
import logo2 from "../../assets/images/svg/logo2.svg";
import close from "../../assets/images/svg/icon-close.svg";
import twitter from "../../assets/images/svg/icon-twitter.svg";
import facebook from "../../assets/images/svg/icon-facebook.svg";
export const MobileMenu = ({ closeModal }) => {
  return (
    <>
      <div className={s.bg}>
        <div className={s.firstlane}>
          <img className={s.logo} src={logo} alt="logo"></img>
          <img
            className={s.close}
            src={close}
            alt="closebutton"
            onClick={closeModal}
          ></img>
        </div>
        <div>
          <div className={s.features}>Features</div>
          <div className={s.pricing}>Pricing</div>
          <div className={s.contact}>contact</div>
          <button className={s.login}>Login</button>
        </div>
        <div className={s.positionsocial}>
          <img className={s.icon} src={facebook} alt="logofacebook"></img>
          <img className={s.icon} src={twitter} alt="logotwitter"></img>
        </div>
      </div>
    </>
  );
};
